uffering, thousands of confident religions, ideologies, and economic doctrines, every hunter and forager, every hero and coward, every creator and destroyer of civilization, every king and peasant, every young couple in love, every mother and father, hopeful child, inventor and explorer, every teacher of morals, every corrupt politician, every “superstar,” every “supreme leader,” every saint and sinner in the history of our species lived there–on a mote of dust suspended in a sunbeam.&lt;/p&gt;&lt;h3 style=&quot;box-sizing: border-box; font-size: 24px; margin: 36px 0px 24px; color: rgb(26, 26, 26); line-height: 30px; font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;Houston&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 24px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;that may have seemed like a very long final phase. The autotargeting was taking us right into a … crater, with a large number of big boulders and rocks … and it required … flying manually over the rock field to find a reasonably good area.&lt;/p&gt;&lt;ul style=&quot;box-sizing: border-box; margin: 0px 0px 24px 48px; padding: 0px; color: rgb(56, 56, 56); font-family: &#039;Open Sans&#039;, Helvetica, Arial, sans-serif; font-size: 15px; line-height: 24px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;I am a stranger. I come in peace. Take me to your leader and there will be a massive reward for you in eternity.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;A good rule for rocket experimenters to follow is this: always assume that it will explode.&lt;/li&gt;&lt;li style=&quot;box-sizing: border-box; padding-left: 6px; margin-bottom: 12px;&quot;&gt;